import React, { useState } from 'react';

function FormularioCadastro({ onCadastro }) {
  const [nome, setNome] = useState('');
  const [telefone, setTelefone] = useState('');
  //const [idade, setIdade] = useState('');
  //const [idade, setIdade] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Validar e salvar os dados
    if (nome && telefone) {
      onCadastro({ nome, telefone });
      setNome('');
      setTelefone('');
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <input
        type="text"
        placeholder="Nome"
        value={nome}
        onChange={(e) => setNome(e.target.value)}
      />
      <input
        type="tel"
        placeholder="Telefone"
        value={telefone}
        onChange={(e) => setTelefone(e.target.value)}
      />
      <div>
                    <input type="radio" id="egresso" name="aluno" value="Egresso"/>
                    <label for="egresso">Egresso</label>
                    <input type="radio" id="sexo-f" name="aluno" value="Convidado"/>
                    <label for="convidado">Convidado</label>
                </div>

                <div>
                    <p>Pago</p>
                    <input type="radio" id="pago" name="pagamento" value="Sim"/>
                    <label for="egresso">Sim</label>
                    <input type="radio" id="nao-pago" name="pagamento" value="Não"/>
                    <label for="convidado">Não</label>
                </div>

                <label for="site">Foto</label>
	            <input type="url" id="site" name="site" required placeholder="URL"></input>
      <button type="submit">Cadastrar</button>
    </form>
  );
}

export default FormularioCadastro;
